</tr>  <tr>    <td width="15%" bgcolor="#EFE5E0">■内　容　量</td>    <td colspan="3" bgcolor="#FFFFFF">-</td>  </tr>  <tr>    <td bgcolor="#EFE5E0">■商品説明</td>    <td colspan="3" bgcolor="#FFFFFF">フェイスラインにキレイな立体感を出して、小顔に仕上げるシェーディングパウダー。自然な陰影が出せる平ブラシつきで、持ち運びにも便利！<br>
<br>
※画像の色見本は参考ですので、正しくは店頭でのご確認をお願いいたします。</td>  
</tr>  <tr>    <td bgcolor="#EFE5E0">■使用方法</td>    <td colspan="3" bgcolor="#FFFFFF">ブラシを寝かせ、陰影をつくりだしたい部分にサッと塗ります。ブラシを立たせて持てば、ノーズシャドウとして鼻筋にも使用できます。 </td>  
</tr>  <tr>    <td bgcolor="#EFE5E0">■ブランド</td>    <td colspan="3" bgcolor="#FFFFFF">&nbsp;&gt;キャンメイク</td>  </tr>  <tr>    <td bgcolor="#EFE5E0">■広告文責</td>    <td colspan="3" bgcolor="#FFFFFF">株式会社エムファクトリー　03-5281-3055</td>  </tr>  <tr>    <td bgcolor="#EFE5E0">■メーカー</td>    <td width="35%" bgcolor="#FFFFFF">株式会社井田ラボラトリーズ</td>    <td width="15%" bgcolor="#EFE5E0">■区　　分</td>    <td width="35%" bgcolor="#FFFFFF">日本製・化粧品</td>  </tr></table><style type="text/css">
